domain = "http://www.tcmap.com.cn"
putian = "/fujian/putian.html"

lua = LuaRuntime() 
func = lua.eval("function(str) return string.match(str, '人口(.-)人') end")

import xlwt
# 创建一个workbook 设置编码
workbook = xlwt.Workbook(encoding = 'utf-8')
# 创建一个worksheet
worksheet = workbook.add_sheet('信息')


prop_list = ["市", "市链接", "区", "区链接", "镇", "镇链接", "乡", "乡链接", "匹配出的人口", "内容"]

for index in range(len(prop_list)):
    worksheet.write(0,index, label = prop_list[index])

id = 1
for qu in qu_list:
    zhen_list = qu["zhen_list"]

    for zhen in zhen_list:
        xiang_list = zhen['xiang_list']
        for xiang in xiang_list:
            worksheet.write(id,0, label = '莆田市')
            worksheet.write(id,1, label = domain + putian)
            worksheet.write(id,2, label = qu['name'])
            worksheet.write(id,3, label = qu['href'])
            worksheet.write(id,4, label = zhen['name'])
            worksheet.write(id,5, label = zhen['href'])
            worksheet.write(id,6, label = xiang['name'])
            worksheet.write(id,7, label = xiang['href'])
            worksheet.write(id,8, label = func(xiang['content']))
            worksheet.write(id,9, label = xiang['content'])
            id = id + 1
    

# 保存
workbook.save('主要信息.xlsx')


